window.bookSummaryJSON = "<p>Inspired by Pixar Animation Studios' latest film, <i>Coco</i>, this middle grade novel will retell the story of the film as well as feature original content expanding upon its rich, vibrant world and characters. </p> <p>Disney-Pixar's <i>Coco</i> is the celebration of a lifetime, where the discovery of a generations-old mystery leads to a most extraordinary and surprising family reunion. Directed by Lee Unkrich (<i>Toy Story 3</i>) and produced by Darla K. Anderson (<i>Toy Story 3</i>), Disney-Pixar's <i>Coco</i> opens in US theaters November 22, 2017. </p>"; 
